import React, { Component } from "react";
import Row from "./Row";
import requests from "./requests";

export default class App extends Component {
  render() {
    return (
      <div>
        <Row
          title="NETFILIX ORGIGINALS"
          fetchUrl={requests.fetchNetflixOriginals}
        />
        <Row title="Trending Now" etchUrl={requests.fetchTrending} />
        <Row title="Top Rated" etchUrl={requests.fetchTopRated} />
        <Row title="Trending Now" etchUrl={requests.fetchActionMovies} />
        <Row title="Trending Now" etchUrl={requests.fetchComedyMovies} />
        <Row title="Trending Now" etchUrl={requests.fetchHorrorMovies} />
        <Row title="Trending Now" etchUrl={requests.fetchRomanceMovies} />
        <Row title="Trending Now" etchUrl={requests.fetchHorrorMovies} />
      </div>
    );
  }
}
